import logo from '../assets/logo.png'

function Login() {
    return (
    <div className='flex items-center justify-center h-full flex-'>
        <img src={logo}></img>
        <p>Email</p>
        <button><p>Email</p></button>
        <p>Password</p>
        <button><p>Password</p></button>
        <p>Forgot your password?</p>
    </div>
    )
  }
  
  export default Login;
